<p class="MsoNormal" style="margin-bottom: .0001pt; text-align: center;" align="center"> </p>
<p style="text-align: center;"><strong>Wojskowa Specjalistyczna Przychodnia Lekarska</strong></p>
<p style="text-align: center;"><strong>Samodzielny Publiczny Zaklad Opieki Zdrowotnej </strong></p>
<p style="text-align: center;">ul. Legionow 57, 86-300 GRUDZIADZ</p>
